gure><figure class=\"kg-card kg-image-card kg-width-wide\"><img src=\"/content/images/2018/10/DSCF1951.JPG\" class=\"kg-image\"></figure><figure class=\"kg-card kg-image-card kg-width-wide\"><img src=\"/content/images/2018/10/DSCF1952.JPG\" class=\"kg-image\"></figure><figure class=\"kg-card kg-image-card kg-width-wide\"><img src=\"/content/images/2018/10/DSCF1954.JPG\" class=\"kg-image\"></figure><figure class=\"kg-card kg-image-card kg-width-wide\"><img src=\"/content/images/2018/10/DSCF1955.JPG\" class=\"kg-image\"></figure><figure class=\"kg-card kg-image-card kg-width-wide\"><img src=\"/content/images/2018/10/DSCF1956.JPG\" class=\"kg-image\"></figure><figure class=\"kg-card kg-image-card kg-width-wide\"><img src=\"/content/images/2018/10/DSCF1957.JPG\" class=\"kg-image\"></figure><figure class=\"kg-card kg-image-card kg-width-wide\"><img src=\"/content/images/2018/10/DSCF1958.JPG\" class=\"kg-image\"></figure><figure class=\"kg-card kg-image-card kg-width-wide\"><img src=\"/content/images/2018/10/DSCF1959.JPG\" class=\"kg-image\"></figure>','5bd95ce69263f77c9da3d9cc','Phone: 090-ba 66-ba 99-ba','/content/images/2018/10/DSCF1935-1.JPG',1,0,'published',NULL,'public',NULL,NULL,'1','2018-10-31 07:42:30','1','2018-10-31 08:20:41','1','2018-10-31 07:47:47','1',NULL,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL),('5bf8e4979263f77c9da3dce4','29ffe0d9-0bd2-483c-9f7f-dac21ace749c','Summary: Call Stack, Event Loop , Tasks','understanding-javascript-function-executions-call-stack-event-loop-tasks-more','{\"version\":\"0.3.1\",\"atoms\":[],\"cards\":[],\"markups\":[[\"code\"]],\"sections\":[[1,\"p\",[[0,[],0,\"JS ecosystem has become more complicated than ever and will continue to become more. the tooling that is required to build a modern web app is overwhelming.  \"]]],[1,\"p\",[[0,[],0,\"But basic foundation of how all of the lib or framework are done internally at the root level. The term V8, chrome\'s Runtime ? some might event didn\'t really know what that meant, what that did. \"]]],[1,\"p\",[[0,[],0,\"I didn\'t satiate my curiosity about how the hell Js is able to do all this stuff =>  decide to dig deep, rummaging around google and came across few good blog posts.\"]]],[1,\"p\",[[0,[0],1,\"Js\"],[0,[],0,\" is a single threaded single concurrent language, meaning it can handle one task at a time or a piece of code at a time. It has a single \"],[0,[0],1,\"call stack\"],[0,[],0,\" which along with other parts like heap, queue constitutes the \"],[0,[0],1,\"Js Concurrency Model\"],[0,[],0,\" (implemented inside of V8).\"]]],[3,\"ul\",[[[0,[0],1,\"Call stack\"],[0,[],0,\" it\'s a data structure which records the function calls, basically where in the program we are. If we call a function to execute, we push something on to the stack, and when we return from a function, we pop off the top of the stack. There is a limit on the size of the stack which is \"],[0,[0],1,\"16,000\"],[0,[],0,\" frames, \"],[0,[0],1,\"Error: \'Maximum call stack size exceeded\'\"]],[[0,[0],1,\"Heap\"],[0,[],0,\" objects are allocated in a heap ( mostly unstructured region of memory). All the memory allocation to variables and objects happens here.\"]],[[0,[0],1,\"Queue\"],[0,[],0,\" a javascript runtime contains a message queue, which is a list of messages to be processed and the associated callback functions to execute. \"]]]]]}','<p>JS ecosystem has become more complicated than ever and will continue to become more. the tooling that is required to build a modern web app is overwhelming. </p><p>But basic foundation of how all of the lib or framework are done internally at the root level. The term V8, chrome\'s Runtime ? some might event didn\'t really know what that meant, what that did. </p><p>I didn\'t satiate my curiosity about how the hell Js is able to do all this stuff =&gt; decide to dig deep, rummaging around google and came across few good blog posts.</p><p><code>Js</code> is a single threaded single concurrent language, meaning it can handle one task at a time or a piece of code at a time. It has a single <code>call stack</code> which along with other parts like heap, queue constitutes the <code>Js Concurrency Model</code> (implemented inside of V8).</p><ul><li><code>Call stack</code> it\'s a data structure which records the function calls, basically where in the program we are. If we call a function to execute, we push something on to the stack, and when we return from a function, we pop off the top of the stack. There is a limit on the size of the stack which is <code>16,000</code> frames, <code>Error: \'Maximum call stack size exceeded\'</code></li><li><code>Heap</code> objects are allocated in a heap ( mostly unstructured region of memory). All the memory allocation to variables and objects happens here.</li><li><code>Queue</code> a javascript runtime contains a message queue, which is a list of messages to be processed and the associated callback functions to execute. </li></ul>','5bf8e4979263f77c9da3dce4','JS ecosystem has become more complicated than ever and will continue to become\nmore. the tooling that is required to build a modern web app is overwhelming.\n\nBut basic foundation of how all of the lib or framework are done internally at\nthe root level. The term V8, chrome\'s Runtime ? some might event didn\'t really\nknow what that meant, what that did. \n\nI didn\'t satiate my curiosity about how the hell Js is able to do all this stuff\n=> decide to dig deep, rummaging around google and came across few good blog\nposts.\n\nJs  is a single threaded single concurrent language, meaning it can handle one\ntask at a time or a piece of code at a time. It has a single call stack  which\nalong with other parts like heap, queue constitutes the Js Concurrency Model \n(implemented inside of V8).\n\n * Call stack  it\'s a data structure which records the function calls, basically\n   where in the program we are. If we call a function to execute, we push\n   something on to the stack, and when we return from a function, we pop off the\n   top of the stack. There is a limit on the size of the stack which is 16,000 \n   frames, Error: \'Maximum call stack size exceeded\'\n * Heap  objects are allocated in a heap ( mostly unstructured region of\n   memory). All the memory allocation to variables and objects happens here.\n * Queue  a javascript runtime contains a message queue, which is a list of\n   messages to be processed and the associated callback functions to execute.',NULL,0,0,'draft',NULL,'public',NULL,NULL,'1','2018-11-24 05:41:43','1','2018-11-25 15:29:53','1',NULL,NULL,NULL,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL),('5bfd14b59263f77c9da3dd2a','0e815163-cb2c-4e76-b982-2ed3e511c842','inst elas','inst-elas','{\"version\":\"0.3.1\",\"atoms\":[],\"cards\":[[\"code\",{\"code\":\"/usr/bin/ruby -e \\\"$(curl -fsSL https://raw.githubusercontent.com/Homebrew/install/master/install)\\\"\"}],[\"code\",{\"code\":\"brew tap caskroom/versions\\nbrew cask install java8\"}],[\"code\",{\"code\":\"ps -ef | grep elas\"}],[\"code\",{\"code\":\"kill <pid>\"}],[\"code\",{\"code\":\"      \\\"sudo sed -i \'s/HAPROXY_PUBLIC_IP/${digitalocean_droplet.haproxy-www.ipv4_address}/g\' /etc/haproxy/haproxy.cfg\\\",\\n\"}]],\"markups\":[[\"code\"],[\"a\",[\"href\",\"https://www.digitalocean.com/community/tutorials/how-to-install-elasticsearch-logstash-and-kibana-elk-stack-on-ubuntu-14-04\"]],[\"strong\"]],\"sections\":[[1,\"p\",[[0,[],0,\"1st: install home brew if not \"]]],[1,\"p\",[[0,[0],1,\"brew install\"],[0,[],0,\" :\"]]],[10,0],[1,\"p\",[[0,[0],1,\"java install\"],[0,[],0,\" : \"],[0,[0],1,\"brew cask install java\"]]],[1,\"p\",[[0,[],0,\"prefer java 8 \"]]],[10,1],[1,\"p\",[[0,[],0,\"cmd: \"]]],[1,\"p\",[[0,[0],1,\"bin/elasticsearch\"],[0,[],0,\"  \"]]],[1,\"p\",[[0,[],0,\"stop \"]]],[10,2],[10,3],[1,\"p\",[[0,[],0,\"./bin/kibana\"]]],[1,\"p\",[]],[1,\"p\",[[0,[],0,\"install fileBeat \"]]],[1,\"p\",[[0,[0],1,\"curl -L -O https://artifacts.elastic.co/downloads/beats/filebeat/filebeat-6.5.1-darwin-x86_64.tar.gz\"],[0,[],0,\" \"]]],[1,\"p\",[[0,[0],1,\"tar xzvf filebeat-6.5.1-darwin-x86_64.tar.gz\"]]],[1,\"p\",[[0,[0],1,\"cd filebeat-6.5.1-darwin-x86_64/\"]]],[1,\"p\",[[0,[],0,\"Modify \"],[0,[0],1,\"filebeat.yml\"],[0,[],0,\" to set the connection information\"]]],[1,\"p\",[[0,[],0,\"enable mysql\"]]],[1,\"p\",[[0,[0],1,\"./filebeat modules enable mysql\"]]],[1,\"p\",[[0,[],0,\"load kibana dashboard\"]]],[1,\"p\",[[0,[],0,\"./filebeat -setup -e\"]]],[1,\"p\",[[0,[1],1,\"https://www.digitalocean.com/community/tutorials/how-to-install-elasticsearch-logstash-and-kibana-elk-stack-on-ubuntu-14-04\"]]],[1,\"p\",[[0,[],0,\"=> next\"]]],[1,\"p\",[[0,[],0,\"setup logstash\"]]],[1,\"p\",[[0,[],0,\"receive log from beatfile\"]]],[1,\"p\",[[0,[],0,\"=> setup server\"]]],[1,\"p\",[]],[1,\"p\",[[0,[],0,\"config nginx\"]]],[10,4],[1,\"p\",[[0,[],0,\"why infrastructure as code ? \"]]],[3,\"ol\",[[[0,[],0,\"Eliminate Fear of accidental misconfiguration.\"]],[[0,[],0,\"Store those source files and entire infrstsructure in version control and captured in commit logs. This can be used to debug problems, and if necessary, roll back to older versions.\"]],[[0,[],0,\"Work continues if the sysadmin goes on Vacation.\"]],[[0,[],0,\"Mitigates some failures.\"]],[[0,[],0,\"Empower developers and operators to create infrastructure with shared templates, thereby keeping developers happy with fast deployments.\"]],[[0,[],0,\"Devops will always say \"],[0,[2,2],2,\"YES!!\"],[0,[],0,\" to all infrastructure requests from engineers.\"]],[[0,[],0,\"Distribution of knowledge.\"]],[[0,[],0,\"Eliminates key-man syndrome.\"]],[[0,[],0,\"Validate each infrastructure change through code reviews and automated tests.\"]]]],[1,\"p\",[]]]}','<p>1st: install home brew if not </p><p><code>brew install</code> :</p><pre><code>/usr/bin/ruby -e \"$(curl -fsSL https://raw.githubusercontent.com/Homebrew/install/master/install)\"</code></pre><p><code>java install</code> : <code>brew cask install java</code></p><p>prefer java 8 </p><pre><code>brew tap caskroom/versions\nbrew cask install java8</code></pre><p>cmd: </p><p><code>bin/elasticsearch</code> </p><p>stop </p><pre><code>ps -ef | grep elas</code></pre><pre><code>kill &lt;pid&gt;</code></pre><p>./bin/kibana</p><p></p><p>install fileBeat </p><p><code>curl -L -O https://artifacts.elastic.co/downloads/beats/filebeat/filebeat-6.5.1-darwin-x86_64.tar.gz</code> </p><p><code>tar xzvf filebeat-6.5.1-darwin-x86_64.tar.gz</code></p><p><code>cd filebeat-6.5.1-darwin-x86_64/</code></p><p>Modify <code>filebeat.yml</code> to set the connection information</p><p>enable mysql</p><p><code>./filebeat modules enable mysql</code></p><p>load kibana dashboard</p><p>./filebeat -setup -e</p><p><a href=\"https://www.digitalocean.com/community/tutorials/how-to-install-elasticsearch-logstash-and-kibana-elk-stack-on-ubuntu-14-04\">https://www.digitalocean.com/community/tutorials/how-to-install-elasticsearch-logstash-and-kibana-elk-stack-on-ubuntu-14-04</a></p><p>=&gt; next</p><p>setup logstash</p><p>receive log from beatfile</p><p>=&gt; setup server</p><p></p><p>config nginx</p><pre><code>      \"sudo sed -i \'s/HAPROXY_PUBLIC_IP/${digitalocean_droplet.haproxy-www.ipv4_address}/g\' /etc/haproxy/haproxy.cfg\",\n</code></pre><p>why infrastructure as code ? </p><ol><li>Eliminate Fear of accidental misconfiguration.</li><li>Store those source files and entire infrstsructure in version control and captured in commit logs. This can be used to debug problems, and if necessary, roll back to older versions.</li><li>Work continues if the sysadmin goes on Vacation.</li><li>Mitigates some failures.</li><li>Empower developers and operators to create infrastructure with shared templates, thereby keeping developers happy with fast deployments.</li><li>Devops will always say <strong><strong>YES!!</strong></strong> to all infrastructure requests from engineers.</li><li>Distribution of knowledge.</li><li>Eliminates key-man syndrome.</li><li>Validate each infrastructure change through code reviews and automated tests.</li></ol>','5bfd14b59263f77c9da3dd2a','1st: install home brew if not \n\nbrew install  :\n\n/usr/bin/ruby -e \"$(curl -fsSL https://raw.githubusercontent.com/Homebrew/install/master/install)\"\n\njava install  : brew cask install java\n\nprefer java 8 \n\nbrew tap caskroom/versions\nbrew cask install java8\n\ncmd: \n\nbin/elasticsearch\n\nstop \n\nps -ef | grep elas\n\nkill <pid>\n\n./bin/kibana\n\n\n\ninstall fileBeat \n\ncurl -L -O\nhttps://artifacts.elastic.co/downloads/beats/filebeat/filebeat-6.5.1-darwin-x86_64.tar.gz \n \n\ntar xzvf filebeat-6.5.1-darwin-x86_64.tar.gz\n\ncd filebeat-6.5.1-darwin-x86_64/\n\nModify filebeat.yml  to set the connection information\n\nenable mysql\n\n./filebeat modules enable mysql\n\nload kibana dashboard\n\n./filebeat -setup -e\n\nhttps://www.digitalocean.com/community/tutorials/how-to-install-elasticsearch-logstash-and-kibana-elk-stack-on-ubuntu-14-04\n\n=> next\n\nsetup logstash\n\nreceive log from beatfile\n\n=> setup server\n\n\n\nconfig nginx\n\n      \"sudo sed -i \'s/HAPROXY_PUBLIC_IP/${digitalocean_droplet.haproxy-www.ipv4_address}/g\' /etc/haproxy/haproxy.cfg\",\n\n\nwhy infrastructure as code ? \n\n 1. Eliminate Fear of accidental misconfiguration.\n 2. Store those source files and entire infrstsructure in version control and\n    captured in commit logs. This can be used to debug problems, and if\n    necessary, roll back to older versions.\n 3. Work continues if the sysadmin goes on Vacation.\n 4. Mitigates some failures.\n 5. Empower developers and operators to create infrastructure with shared\n    templates, thereby keeping developers happy with fast deployments.\n 6. Devops will always say YES!!  to all infrastructure requests from engineers.\n 7. Distribution of knowledge.\n 8. Eliminates key-man syndrome.\n 9. Validate each infrastructure change through code reviews and automated\n    tests.',NULL,0,0,'draft',NULL,'public',NULL,NULL,'1','2018-11-27 09:56:05','1','2018-12-04 02:35:20','1',NULL,NULL,NULL,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL),('5c0299319263f77c9da3ddb5','5fbf0d84-d31a-423a-948b-4810671b1ce8','blog-list-2018','rest','{\"version\":\"0.3.1\",\"atoms\":[],\"cards\":[],\"markups\":[[\"code\"],[\"a\",[\"href\",\"https://blog.feathersjs.com/design-patterns-for-modern-web-apis-1f046635215\"]]],\"sections\":[[1,\"p\",[[0,[0],1,\"REST\"],[0,[],0,\": \"],[0,[1],1,\"https://blog.feathersjs.com/design-patterns-for-modern-web-apis-1f046635215\"]]],[1,\"p\",[]]]}','<p><code>REST</code>: <a href=\"https://blog.feathersjs.com/design-patterns-for-modern-web-apis-1f046635215\">https://blog.feathersjs.com/design-patterns-for-modern-web-apis-1f046635215</a></p>','5c0299319263f77c9da3ddb5','REST: \nhttps://blog.feathersjs.com/design-patterns-for-modern-web-apis-1f046635215',NULL,0,0,'published',NULL,'public',NULL,NULL,'1','2018-12-01 14:22:41','1','2018-12-01 14:24:18','1','2018-12-01 14:24:16','1',NULL,'','',NULL,NULL,NULL,NULL,NULL,NULL,NULL);
